import React from 'react';
import Inicio from './Plantilla';
import './../App.css';

export default function Tienda() {
  return (
    <Inicio>
      <div class="container">
        <div class="box">Div 1</div>
        <div class="box">Div 2</div>
        <div class="box">Div 3</div>
        <div class="box2">Div 4</div>
      </div>
    </Inicio>
  )
}
